This request involves the implementation of the protected method createThread in org.eclipse.jdt.internal.debug.core.model.JDIDebugTarget.  Currently, createThread creates a JDIThread using a direct constructor call and then adds the thread to the ArrayList fThreads.  fThreads is a private member variable, so any subclass of JDIDebugTarget cannot access it when overriding createThread.

I'd like to request a minor change where a template method is used in place of the direct constructor call.  This method could be as simple as:

protected JDIThread createThreadTemplateMethod(ThreadReference thread) {
    return new JDIThread(this, thread);
}

This would allow subclasses of JDIDebugTarget to override the template method for the purpose of returning a subclass of JDIThread.  Otherwise, the subclass of JDIDebugTarget must have it's own separate ArrayList of threads and override all the methods that access fThreads either directly or indirectly using getThreadIterator (which is private).  There are many such methods.

The purpose of this request is to support the extensibility of the JDT debugger.  While this does require subclassing internal classes, currently there are limited means to enhancing the existing JDT debugger without re-implementing every internal class.  Without going into all the details, the reason we need to subclass JDIDebugTarget and JDIThread is to support reverse execution (stepping).

