I'm using the Undo and Redo actions created with ActionFactory.UNDO.create() and ActionFactory.REDO.create() in a toolbar. If I hover over them the tooltip says "&Undo action" and "&Redo action". Looks like they use the title messages instead of the tooltip messages for tooltips. 

I found this code in OperationHistoryActionHandler.update():

String text = getCommandString();
String tooltipText;
if (enabled) {
    tooltipText = NLS.bind(WorkbenchMessages.Operations_undoRedoCommand, text, getOperation().getLabel());

So the tooltipText variable is filled with the string returned by getCommandString(). This one is defined in UndoActionHandler and RedoActionHandler and just returns the message resource "WorkbenchMessages.Workbench_undo" and "WorkbenchMessages.Workbench_redo". But for the tooltip "WorkbenchMessages.Workbench_undoToolTip" and "WorkbenchMessages.Workbench_redoToolTip" must be used instead.

